import styled from "styled-components";

export const Cabecalho = styled.div`

background-color: black;
color: white;
margin-top: 0;
padding: 1%;
/* font-family: Arial, Helvetica, sans-serif; */


`;

export const Titulo = styled.h1`

font-family: Arial, Helvetica, sans-serif;


`;
